import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import App from './App';
import Profile from './Profile';


function HomePage() {
  return (
    <Router>
      <Switch>
        <Route  path="/" component={<App />} />
        <Route  path="/profile" component={<Profile />} />     
      </Switch>
    </Router> 
  );
}

export default HomePage;


